/**
            * All input variables needs to be passed as function param;
            * Objects received as param needs to be parsed. Ex.: JSON.parse(inputVariable1);
            * Objects returned needs to be stringfied. Ex.: JSON.stringify(inputVariable1);
            **/
            function run(dataContent) {
                var json = JSON.parse(dataContent);

                var obj = {
                    id1: json[0].id,
                    name1: json[0].name,
                    description1: json[0].description,

                    id2: json[1].id,
                    name2: json[1].name,
                    description2: json[1].description,

                    id3: json[2].id,
                    name3: json[2].name,
                    description3: json[2].description,

                    id4: json[3].id,
                    name4: json[3].name,
                    description4: json[3].description,

                    id5: json[4].id,
                    name5: json[4].name,
                    description5: json[4].description,
                }

                if(obj == null) {
                    return JSON.stringify(new Object());
                }
                else {
                    return JSON.stringify(obj);
                }
            }
